import React from 'react';

import { Container } from './styles';

export default function Cart() {
  return (
    <Container>
      <ProductTable />
      <footer>
        <button type="submit">Proceed to Checkout</button>
        <Total>
          <span>TOTAL:</span>
          <strong>R$ 120,00</strong>
        </Total>
      </footer>
    </Container>
  );
}
